import React,{Component} from 'react';


export class ImageWord extends Component{
    
    render(){
        const data = [{ name: "John Doe", "age": 44 }, { name: "Jane Doe", "age": 45 }];
        
        return(
            <div>data</div>
            
        )
    }
}
export default function MyExampleComponent() {
    const componentArray = [
    <p key="example-key-1">Hello World</p>,
    <p key="example-key-2">Hello World</p>,
    ];
   
    return (
      <div>
        {componentArray}
      </div>
    );
   }
